document.addEventListener("DOMContentLoaded", function() {
    if (document.querySelectorAll(".aboutUs").length > 0) {
      let blockLeft = document.querySelector(
        ".our-awards .video-description__text"
      ).offsetLeft;
      let h1Left = document.querySelector(
        ".our-awards .video-description__text h1"
      ).offsetLeft;
      // console.log(blockLeft, h1Left);
      document.querySelector(
        ".our-awards .video-description__text"
      ).style.left = `${blockLeft + h1Left + 10}px`;
    }

    if (document.querySelectorAll(".aboutUs").length > 0) {
        let dropDown = Array.from(document.querySelectorAll(".awards__arrow"));
        
        dropDown.forEach((elem) => {
            elem.addEventListener("click", (e) => {
                let list = e.currentTarget.nextSibling;
                list.classList.toggle("active");
            })
        })    
    }
});
(function($){
    $(function() {
      $('.header-nav__burger').on('click', function() {
        $(this).closest('.header-nav').toggleClass('state_open');
      });
    });
})(jQuery);



document.addEventListener("DOMContentLoaded", ()=> {
    let burger = document.querySelector(".header-nav__burger");
    
    burger.addEventListener("click", () => {
        burger.classList.toggle("toggle");
    });
});



document.addEventListener("DOMContentLoaded", function() {
  if (document.querySelectorAll(".contacts-page").length > 0) {
    
    let cards = Array.from(document.querySelectorAll('.main-offices-list__item'));
    let answ = document.querySelector('.main-callback-answ');

    let lastCard = cards[cards.length-1];

    function getCoords(elem) {
      var box = elem.getBoundingClientRect();
      return {
        top: box.top + pageYOffset,
        left: box.left + pageXOffset
      };
    }

    let cardX = getCoords(lastCard).left + lastCard.offsetWidth;
    console.log(cardX);
    let cardY = getCoords(lastCard).top + lastCard.offsetHeight;
    console.log(cardY);

    let answX = getCoords(answ).left;
    let answY = getCoords(answ).top;

    if (answX <= cardX && answY <= cardY) {
      document.querySelector('.main-offices').style.paddingBottom = "140px";
    }

  }
});

